import React from "react";
import { Form } from "react-bootstrap";

const AuthInput = (props,hola) => {
  let { registrado } = props;

  if (!registrado) {
    return (<Form.Group controlId="formBasicPassword">
            <Form.Label>{hola}</Form.Label>
            <Form.Control/>
        </Form.Group>);
  }
  else {
      return null
  } 
};

export default AuthInput;
